/// WebCodecs-specific function to extract HVCC from an Annex B encoded chunk
pub fn create_hvcc_box(annexb_data: &[u8]) -> Vec<u8> {
    let nalus = find_nal_units(annexb_data);
    create_hvcc(&nalus)
}

/// WebCodecs-specific function to convert Annex B data to length-prefixed format
pub fn convert_annexb_to_length_prefixed(annexb_data: &[u8], exclude_parameter_sets: bool) -> Vec<u8> {
    let nalus = find_nal_units(annexb_data);
    convert_to_length_prefixed(&nalus, exclude_parameter_sets)
}

